import { BrowserRouter, Routes, Route, Navigate } from "react-router-dom";
import Login from "./Auth/Login";
import Dashboard from "./Dashboard/Dashboard";
import { AuthProvider } from "./Auth/AuthContext";
import ProtectedRoute from "./Auth/ProtectedRoute";
import Users from "./Auth/Users";
import CompanyProfile from "./pages/Company/CompanyProfile";
import ChartOfAccount from "./pages/Accounting/ChartOfAccount";
import Currency from "./pages/Currency/Currency";
import KategoriList from "./pages/MasterData/KategoriList";
import NamaTipeAkun from "./pages/MasterData/NamaTipeAkun";





function App() {
  return (
    <AuthProvider>
      <BrowserRouter>
        <Routes>
          <Route path="/login" element={<Login />} />
          <Route
            path="/dashboard"
            element={
              <ProtectedRoute>
                <Dashboard />
              </ProtectedRoute>
            }
          />
          <Route
            path="/company/profile"
            element={
              <ProtectedRoute>
                <CompanyProfile />
              </ProtectedRoute>
            }
          />
          <Route
            path="/accounting/chart-of-accounts"
            element={
              <ProtectedRoute>
                <ChartOfAccount />
              </ProtectedRoute>
            }
          />
          <Route
            path="/master/currency"
            element={
              <ProtectedRoute>
                <Currency />
              </ProtectedRoute>
            }
          />
          <Route
            path="/master/users"
            element={
              <ProtectedRoute allowedRoles={['admin']}>
                <Users />
              </ProtectedRoute>
            }
          />
          <Route
            path="/master/category"
            element={
              <ProtectedRoute>
                <KategoriList />
              </ProtectedRoute>
            }
          />
          <Route
            path="/master/tipe-akun"
            element={
              <ProtectedRoute>
                <NamaTipeAkun />
              </ProtectedRoute>
            }
          />
          {/* Default routes */}
          <Route path="/" element={<Navigate to="/login" />} />
          <Route path="*" element={<Navigate to="/login" />} />
        </Routes>
      </BrowserRouter>
    </AuthProvider>
  );
}

export default App;
